--Unit SN	
--Unit Status	
--Unit State ID	
--Unit State	
--Station	
--Station Type	
--Creation Time	
--Last Update	
--Partnumber	
--Production Order Number	
--Tray	
--Sample	
--Box SN		
--Pallet SN

/*
SELECT TOP 100 * FROM ffStation
SELECT TOP 100 * FROM ffStationType
SELECT TOP 100 * FROM ffPart
SELECT TOP 100 * FROM ffunitdetail
SELECT TOP 100 * FROM luUnitStatus
SELECT TOP 100 * FROM luPackageStatus
SELECT TOP 100 * FROM ffProductionOrder
SELECT TOP 100 * FROM ffPackage
SELECT TOP 10000 * FROM ffSerialNumber
SELECT TOP 100 * FROM ffUnitComponent
*/


SELECT FS.Value as UnitSN,
LUS.Description AS UnitStatus,
FUS.ID AS UnitStateID,
FUS.Description AS UnitState,
S.Description AS Station,
ST.Description AS StationType,
u.CreationTime as CreationTime,
u.LastUpdate as LastUpdate,
--LUS.Description AS Status,
P.PartNumber,
PO.ProductionOrderNumber AS UnitWO,
kpo.ProductionOrderNumber KitpackWO,
FUD.Reserved_14 AS Tray,
FUD.Reserved_19 AS Sample,
'''' + kpbox.SerialNumber KitpackBox,
kppallet.SerialNumber KitpackPallet
--S.Description as Station,
--ST.Description as StationType 
FROM ffUnit U
INNER JOIN ffSerialNumber FS WITH (NOLOCK) ON FS.UnitID = U.ID
INNER JOIN ffUnitDetail FUD WITH(NOLOCK) ON FUD.UnitID = U.ID
--INNER JOIN UDTTRAY UDT WITH(NOLOCK) ON UDT.unitid = fud.UnitID
--INNER JOIN ffSerialNumber FS2 WITH(NOLOCK) ON FS2.UnitID = UDT.ID
INNER JOIN ffStation S WITH(NOLOCK) ON S.ID = U.StationID
inner join ffPart P with(nolock) on P.ID = U.PartID
inner join ffStationType ST with(nolock) on ST.ID = S.StationTypeID
inner join luUnitStatus LUS with(nolock) on LUS.ID = U.StatusID
inner join ffProductionOrder PO with(nolock) on PO.ID = U.ProductionOrderID
INNER JOIN ffUnitState FUS WITH(NOLOCK) ON FUS.ID = U.UnitStateID
LEFT OUTER JOIN ffUnitComponent uc WITH(nolock) ON U.ID = uc.ChildUnitID
LEFT OUTER JOIN ffUnit ku WITH(nolock) ON uc.UnitID = ku.ID
LEFT OUTER JOIN ffSerialNumber ksn WITH(nolock) ON ku.ID = ksn.UnitID and ksn.SerialNumberTypeID = 0
LEFT OUTER JOIN ffProductionOrder kpo WITH(nolock) ON ku.ProductionOrderID = kpo.ID 
LEFT OUTER JOIN fflineOrder klo WITH(nolock) ON kpo.ID = klo.ProductionOrderID
LEFT OUTER JOIN ffLine kl WITH(nolock) ON klo.LineID = kl.ID
LEFT OUTER JOIN ffUnitDetail kud WITH(nolock) ON ku.ID = kud.UnitID
LEFT OUTER JOIN ffPackage kpbox WITH(nolock) ON kud.InmostPackageID = kpbox.ID
LEFT OUTER JOIN ffPackage kppallet WITH(nolock) ON kud.OutmostPackageID = kppallet.ID
